import React, { Component } from "react";

class Mobile extends Component {

  constructor(props) {
    super(props);

    this.state = {
      email: "",
      password: ""
    };
  }

  render() {
    return (
      <div id="mobileContent">
        <h1>Events</h1>
        <div className="event">
          <img src="../event.png" />
          <span className="eventDetails">
            <span className="eventTitle">
              LA County Fair
            </span>
            <span className="eventAddress">
              1101 W. McKinley Ave.
              Pomona, CA 91768
            </span>
          </span>
        </div>
      </div >
    )
  };
}


export default Mobile;
